import React, { Component } from "react";

export default class Produk extends Component {
  render() {
    return (
      <div className="box-stock">
        <h2>Nama Produk</h2>
        <img
          src="https://source.unsplash.com/640x480?technology"
          alt="technology"
        />
        <p>Harga</p>
        <p>Stok</p>
        <button className="btn-click">Beli</button>
        <p>Status</p>
      </div>
    );
  }
}
